sys_variable_value.value:
(function execute(inputs, outputs) {
  var eventId  = inputs.eventId.trim();
 if (eventId.length == 0) {
        throw "Error while updating Event, invalid inputs have been passed.";
    }
    outputs.event_id = inputs.eventId;
    outputs.calendar_id = inputs.calendarId.trim() || "primary";
})(inputs, outputs);

